import React from "react";
import '../../css/guideBook.css';

const GuideBook = () => {
    return (
        <>
            <div className="review-model">
                <div className="model-content">
                    <h3>Guide Book</h3>
                </div>
            </div>
        </>
    )
}
export default GuideBook;
